import React from 'react';
import ReactDom from 'react-dom';

const name = "saim khan"

ReactDom.render(
    <>
    <h1 contentEditable="true">wellcome to {name}</h1>
    <img src="https://images.unsplash.com/photo-1612151855475-877969f4a6cc?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=889&q=80"></img>

    </>,
    document.getElementById("root")

);
